import "./App.css";
// import Admin from "./Components/AdminPage/Admin";
import LoginPage from "./Components/LoginPage/LogIn";
import Nav from "./Components/Navbar/Nav";
import Footer from "./Components/Footer/Footer";



function App() {
  return (
    <wrapper>
   <div>
     <Nav />
     </div>
     <div>
     <LoginPage />
     </div>
      <div>
     <Footer />
     </div>
     </wrapper>


  );
}

export default App;
